"use strict";
var Navbar = function() {
        var e = $(".navbar"),
            t = $('.nav-link[href^="#"]'),
            n = $(".navbar-collapse"),
            o = $(window);
        function s() {
            e.removeClass("navbar-light").addClass("navbar-dark")
        }
        function i() {
            e.removeClass("navbar-dark").addClass("navbar-light")
        }
        function l() {
            5 < o.scrollTop() ? s() : i()
        }
        l(),
            o.on({
                scroll: function() {
                    l()
                },
                "activate.bs.scrollspy": function() {
                    t.filter(".active").focus()
                }
            }),
            n.on({
                "show.bs.collapse": function() {
                    s()
                },
                "hidden.bs.collapse": function() {
                    0 == o.scrollTop() && i()
                }
            }),
            t.on("click", function() {
                n.collapse("hide")
            })
    }(),
    Menu = function() {
        var o = $(".section_menu__grid"),
            s = $(".section_menu__nav");
        o.length && o.each(function() {
            var e = $(this),
                t = e.attr("id"),
                n = s.find('li.active > a[href="#' + t + '"]').data("filter"),
                o = e.isotope({
                    itemSelector: ".section_menu__grid__item",
                    filter: n
                });
            o.imagesLoaded().progress(function() {
                o.isotope("layout")
            })
        }),
            s.on("click", "li > a", function(e) {
                e.preventDefault();
                var t = $(this);
                !function(e) {
                    var t = o.filter(e.attr("href")),
                        n = e.data("filter");
                    t.isotope({
                        filter: n
                    })
                }(t),
                    function(e) {
                        e.parent("li").siblings("li").removeClass("active"),
                            e.parent("li").addClass("active")
                    }(t)
            })
    }(),
    Events = function() {
        var t = $(".section_events__items"),
            n = $(".section_events__item"),
            e = $(".section_events__item__content_sm");
        $(".section_events__item__content_lg");
        e.on("click", function() {
            !function(e) {
                e.closest(t).find(n).removeClass("active"),
                    e.closest(n).addClass("active")
            }($(this))
        })
    }(),
    Gallery = function() {
        var e = $(".section_gallery__grid");
        e.length && e.each(function() {
            var e = $(this).isotope({
                itemSelector: ".section_gallery__grid__item"
            });
            e.imagesLoaded().progress(function() {
                e.isotope("layout")
            })
        })
    }(),
    CurrentDate = function() {
        var e,
            t = $("#js-current-year");
        t.length && (e = (new Date).getFullYear(), t.text(e))
    }(),
    Dishes = function() {
        var e = $(".section_dishes__carousel");
        e.length && e.each(function() {
            $(this).flickity({
                cellAlign: "left",
                setGallerySize: !1,
                wrapAround: !0,
                pageDots: !1,
                imagesLoaded: !0
            })
        })
    }(),
    Carousel = function() {
        var e = $(".section_carousel__slider");
        e.length && e.each(function() {
            $(this).flickity({
                cellAlign: "left",
                wrapAround: !0,
                imagesLoaded: !0
            })
        })
    }(),
    Testimonials = function() {
        var e = $(".section_testimonials__carousel");
        e.length && e.each(function() {
            $(this).flickity({
                cellAlign: "left",
                wrapAround: !0,
                imagesLoaded: !0
            })
        })
    }();

